import cover_image from '../assets/cover_image.jpg'


const colors = {
    primary: "#060606",
    background: "#E0E0E0", 
    disbaledd: "#D9D9D9"
}


const Login = () => {
    return (
    <div className="w-full h-screen flex items-start">
      {/* Container utama dengan gambar sebagai background */}
      <div 
        className="relative w-1/2 h-full flex flex-col" 
        style={{
          backgroundImage: `url(${cover_image})`,
          backgroundSize: 'cover',
          backgroundPosition: 'center'
        }}
      >
        {/* Teks muncul di depan gambar */}
        <div className='absolute top-[20%] left-[10%] flex flex-col'>
          <h1 className='text-4xl text-white font-bold my-4'>Turn Your Ideas into Reality</h1>
          <p className='text-xl text-white font-normal'>Start for free and get attractive offers from the community</p>
        </div>
      </div>
    </div>
    )
}

export default Login;
